func doInit(msg *nats.Msg) (ret []byte, err error) {
	pid, _, err := jdbcomm.ParsePidSfsObject(msg.Data)
	if err != nil {
		return nil, err
	}

	err = db.CallWithPlayer(pid, func(plr *jdbcomm.Player) error {
		var data map[string]interface{}
		if err := json.Unmarshal([]byte(sampleDoInit), &data); err != nil {
			fmt.Println("Error unmarshaling JSON:", err)
			return err
		}
		info, err := redisx.LoadAppIdCache(plr.AppID)
		if err != nil {
			return err
		}
		// 
		if betCombinations, ok := data["singleBetCombinations"].(map[string]interface{}); ok {
			betCombinations = make(map[string]interface{})
			newBetCombinations := make(map[string]interface{})
			for i := range info.Cs {

				key := fmt.Sprintf("10_%0.f_%d_NoExtraBet", info.Cs[i], internal.Line)
				key2 := fmt.Sprintf("10_%0.f_%d_ExtraBet_01", info.Cs[i], internal.Line)
				newBetCombinationsKey := fmt.Sprintf("%0.f_%d_NoExtraBet", info.Cs[i], internal.Line)
				newBetCombinationsKey2 := fmt.Sprintf("%0.f_%d_ExtraBet_01", info.Cs[i], internal.Line)
				betCombinations[key] = info.Cs[i] * internal.Line
				betCombinations[key2] = info.Cs[i] * internal.Line * 1.5
				newBetCombinations[newBetCombinationsKey] = info.Cs[i] * internal.Line
				newBetCombinations[newBetCombinationsKey2] = info.Cs[i] * internal.Line * 1.5
			}
			data["singleBetCombinations"] = betCombinations
			data["betCombinations"] = newBetCombinations
		}
		modifiedJSON, err := json.MarshalIndent(data, "", "  ")
		if err != nil {
			fmt.Println("Error marshaling JSON:", err)
			return err
		}
		ret = modifiedJSON
		//curItem := lazy.GetCurrencyItem(plr.CurrencyKey)
		//todo 
		//c, err := redisx.GetPlayerCs(plr.AppID, plr.PID, true)
		//if err != nil {
		//	return err
		//}

		plr.SpinCountOfThisEnter = 0
		return nil
	})

	return
}
